import React from "react";
import Link from "next/link";
import Page from "../components/Page";

function index() {
	return (
		<Page>
			<p>Home page Boi</p>
			<Page />
			<Link href="/sell">
				<a>Back to sell page </a>
			</Link>

			<Link href="/products">
				<a>Back to products page </a>
			</Link>

			<Link href="/account">
				<a>Back to account page </a>
			</Link>

			<Link href="/orders">
				<a>Back to orders page </a>
			</Link>
		</Page>
	);
}

export default index;
